import React, { useState } from 'react';
import Sidebar from '../components/Sidebar';
import CssBaseline from '@mui/material/CssBaseline';
import Container from '@mui/material/Container';
import OptionTab from '../components/OptionTab';

const Undefined = () => {
  const [droppedTab, setDroppedTab] = useState(false);

  // Define the dropHandler function here
  const dropHandler = () => {
    // Handle the drop action
    setDroppedTab(true);
  };

  return (
    <div style={{ display: 'flex' }}>
      <CssBaseline />
      <Sidebar />
      <Container
        onDragOver={(e) => e.preventDefault()} // Allow drop events
        onDrop={dropHandler} // Handle the drop action
        style={{ minHeight: '100vh' }}
      >
        <h1>Main Content</h1>
        {droppedTab ? <OptionTab /> : null}
      </Container>
    </div>
  );
};

export default Undefined;
